import React, { useState } from 'react';
import Header from '../components/header';
import Nav2 from '../components/nav2';
import Footer from '../components/footer';
// import { Link } from 'react-router-dom';
import './style/accountmanage.css'
import PageNavBlock from '../components/pagenavblock';

function AccountManage() {
    /*
    const navigate = useNavigate();
  
    const ProductClick = (event) => {
      event.preventDefault(); 
      navigate('/detail');
    };
    */

    const adminArray = [{username : "mart1az",email : "marz@gmail",firstName : "marz"}
                        ,{username : "james303",email : "james@gmail",firstName : "james"},
                      ,{username : "heisenberg",email : "walterwhite@gmail",firstName : "walter"}
                      ,{username : "mike",email : "kime@gmail",firstName : "mike"}]
    
    const [totalAdmin,setTotalAdmin] = useState(adminArray.length);
    const itemPerPage = 5;
    const [totalPage,setTotalPage] = useState(Math.floor(totalAdmin/itemPerPage) + 1);
    const [currentPage,setCurrentPage] = useState(1);

    function renderBagsRow(){
      const returnedList = [];
      for(let i = (currentPage - 1) * itemPerPage;i < currentPage * itemPerPage && i < bagsArray.length;i++){
        returnedList.push(<tr>
          <td>{i}</td>
          <td><img class = "lowerBrightness" src = {bagsArray[i].BagImages[0]}></img></td>
          <td>{bagsArray[i].BagName}</td>
          <td>{bagsArray[i].BagCatagory}</td>
          <td>{bagsArray[i].BagColor}</td>
          <td>{bagsArray[i].BagStock}</td>
          <td>{bagsArray[i].BagPrice + ".00"}</td>
          <td><img class = "editButton" src = {process.env.PUBLIC_URL + "/assets/edit-text.png"}></img></td>
          <td><img class = "editButton" src = {process.env.PUBLIC_URL + "/assets/edit-text.png"}></img></td>
        </tr>);
      }
      return returnedList;
    }
                  
    return (
      <div>
        <Header/>
        <Nav2 />
        <section class = "page-container-accountmanagement">

          <section class = "nav">

            <div class = "left">
            <img class = "logo" src={process.env.PUBLIC_URL + "/assets/system.png"} alt="productmanage" />
            account management
            </div>

            <div class = "right">
              <button class = "addButton">
                add new
              </button>
            </div>
              
          </section>

          <section class = "mainNav">

            <div class = "searchBar">
              <input class = "searchInput" placeholder='search' type="text"></input>
              <img class = "searchButton" src = {process.env.PUBLIC_URL + "/assets/search.png"}></img>
            </div>
            
          </section>

          <section class = "edit-table-container">

            <table class = "edit-table">

              <thead>
              <tr>
                
                <th>username:</th>
                <th>firstname:</th>
                <th>email</th>
                <th>A</th>
                <th>D</th>
  
              </tr>
              </thead>

              <tbody>
              {/* <tr>
                
                <td>username:</td>
                <td>firstname:</td>
                <td>email</td>
                <td>A</td>
                <td>D</td>
  
              </tr> */}

                  {/* {renderBagsRow()} */}

              </tbody>
              
              
            </table>

          </section>

        </section>
        <Footer />
      </div>
    );
  }
  
  export default AccountManage;
